package model;

public class Magacin {
	Integer id;
	String naziv;
	Integer sektorID;
	Integer prometniDokID;
	public Magacin() {
		super();
		// TODO Auto-generated constructor stub
	}
	public Integer getId() {
		return id;
	}
	public void setId(Integer id) {
		this.id = id;
	}
	public String getNaziv() {
		return naziv;
	}
	public void setNaziv(String naziv) {
		this.naziv = naziv;
	}
	public Integer getSektorID() {
		return sektorID;
	}
	public void setSektorID(Integer sektorID) {
		this.sektorID = sektorID;
	}
	public Integer getPrometniDokID() {
		return prometniDokID;
	}
	public void setPrometniDokID(Integer prometniDokID) {
		this.prometniDokID = prometniDokID;
	}
	
	
	
}
